import Login from '../components/login';

import '../style/Member.css';

// 메뉴바에서 'componentvalue'의 이름으로 출력될 컴포넌트를 판별.
const Member = (props) => {

    if (props.componentvalue === 'memberlogin')
        return <Login/>

}

export default Member;
